import { useState, useEffect, useCallback } from "react";
import { useNavigate } from "react-router-dom";
import { useAuth } from './AuthContext';

const MiCuenta = () => {
  const { logout } = useAuth();
  const [usuario, setUsuario] = useState(null);
  const [nombre, setNombre] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [mensaje, setMensaje] = useState("");
  const navigate = useNavigate();

  const obtenerUsuario = useCallback(async () => {
    const jwt = localStorage.getItem("jwt");
    if (!jwt) {
      navigate("/login");
      return;
    }

    try {
      const response = await fetch("http://gestion.local/api/user", {
        method: "GET",
        headers: {
          "Authorization": `Bearer ${jwt}`,
        },
      });
      if (response.ok) {
        const data = await response.json();
        setUsuario(data);
        setNombre(data.nombre);
        setEmail(data.email);
      } else {
        setMensaje("No se pudo obtener el usuario.");
      }
    } catch (error) {
      setMensaje("Error al obtener el usuario.");
      console.error(error);
    }
  }, [navigate]);

  useEffect(() => {
    obtenerUsuario();
  }, [obtenerUsuario]);

  const eliminarUsuario = async () => {
    const confirmacion = window.confirm("¿Estás seguro de que quieres borrar tu usuario?");
    if (confirmacion) {
      const jwt = localStorage.getItem("jwt");
      if (!jwt) {
        navigate("/login");
        return;
      }

      try {
        const response = await fetch("http://gestion.local/api/user", {
          method: "DELETE",
          headers: {
            "Authorization": `Bearer ${jwt}`,
          },
        });

        if (response.ok) {
          localStorage.removeItem("jwt");
          localStorage.removeItem("expira");
          logout(); // Llamar al logout para actualizar el estado
          navigate("/");
        } else {
          setMensaje("Error al eliminar el usuario.");
        }
      } catch (error) {
        setMensaje("Error al eliminar el usuario.");
        console.error(error);
      }
    }
  };

  return (
    <div style={{ padding: "20px" }}>
      <h1>Mi Cuenta</h1>
      {usuario ? (
        <div>
          <p><strong>Nombre:</strong> {usuario.nombre}</p>
          <p><strong>Email:</strong> {usuario.email}</p>

          <div>
            <h3>Actualizar Datos</h3>
            <div>
              <label>Nombre:</label>
              <input
                type="text"
                value={nombre}
                onChange={(e) => setNombre(e.target.value)}
              />
            </div>
            <div>
              <label>Email:</label>
              <input
                type="email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
              />
            </div>
            <div>
              <label>Contraseña:</label>
              <input
                type="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
            </div>
            <button onClick={actualizarUsuario}>Actualizar</button>
          </div>

          <div>
            <button onClick={eliminarUsuario} style={{ backgroundColor: "red", color: "white" }}>
              Eliminar Cuenta
            </button>
          </div>

        </div>
      ) : (
        <p>Cargando datos de usuario...</p>
      )}

      {mensaje && <p>{mensaje}</p>}
    </div>
  );
};

export default MiCuenta;
